import React from 'react';
import { useNavigate } from 'react-router-dom';
// Ensure Tailwind CSS is correctly imported in your project setup
import Navbar from "../navbar/Navbar.jsx";
import backgroundImage from './background.jpeg';


function Login() {
    // Prevent form submission for demonstration purposes
    const handleLogin = (event) => {
      event.preventDefault();
      // Here you would typically handle the login logic
    };

    return (
        <div className="flex items-center justify-center min-h-screen bg-gray-100 p-4" style={{ backgroundImage: `url(${backgroundImage})`, backgroundSize: 'cover', backgroundPosition: 'center' }}>
          <div className="w-full max-w-md">
            <div className="bg-white p-8 border rounded-lg shadow-lg">
              <h2 className="mb-4 text-3xl font-bold text-center text-gray-900">Welcome.</h2>
              <form>
                <div className="mb-4">
                  <label htmlFor="email" className="block text-sm font-medium text-gray-700">Email address</label>
                  <input type="email" id="email" className="mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:border-indigo-500 focus:ring-1 focus:ring-indigo-500" placeholder="Email address" />
                </div>
                <div className="mb-6">
                  <label htmlFor="password" className="block text-sm font-medium text-gray-700">Password</label>
                  <input type="password" id="password" className="mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:border-indigo-500 focus:ring-1 focus:ring-indigo-500" placeholder="Password" />
                </div>
                <div>
                  <button type="submit" className="w-full px-4 py-2 text-sm font-medium text-white bg-black rounded-md hover:bg-gray-800 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500">Log In</button>
                </div>
              </form>
              <p className="mt-4 text-sm text-center text-gray-600">
                Don't have an account? <a href="/register" className="font-medium text-indigo-600 hover:text-indigo-500">Register here.</a>
              </p>
            </div>
          </div>
        </div>
      );
    };

export default Login;
